import React, { Component } from 'react'
import { Segment, Container, Header } from "semantic-ui-react";
import { OrderDetailsSellerDecision } from "./OrderDetailsSellerDecision";
import { connect } from 'react-redux';

  class AuctionWithoutMinPrice extends Component {
    render() {
        return (
          <Container>
            <Segment>
              <Header as='h1'>Resell Item(s) on Platform as Auction without Min Price</Header>
              <OrderDetailsSellerDecision urlOrderId={this.props.match.params.id} sellerDecision={"AuctionWithoutMinPrice"} />
              
            </Segment>
          </Container>
        );
      }
}

const mapState = (state) => ({});

const actionCreators = {};

const connectedAuctionWithoutMinPrice = connect(mapState, actionCreators)(AuctionWithoutMinPrice);

export { connectedAuctionWithoutMinPrice as AuctionWithoutMinPrice };
